import React, { Component } from "react";

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <div className="toprow">
          <div className="streamgraph">
            <h1>I dey mad</h1>
          </div>
          <div className="piechart">
            <h1>I dey mad</h1>
          </div>
        </div>
        <div className="secondrow">
          <div className="streamgraph">
            <h1>I dey mad</h1>
          </div>
          <div className="piechart">
            <h1>I dey mad</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default Dashboard;
